import './App.css';
import React, {Component} from 'react';

class App extends Component{
  state = {
    selectedFile: null,
    fileUploadedSuccessfully: false
  }

  render(){
    return (
      <div>
        <h2> 카톡 대화 분석 서비스</h2>
        <h3> Advancer </h3>
        <div>
          <input type = "file" oneChange = {this.onFileChange} />
          <button onClick={this.onFileUpload}>
            파일 업로드
          </button>
        </div>
        {this.fileData()}
      </div>
    )
  }
}

export default App;
